import React from 'react';
import styled from 'styled-components';
import photoinput from '../assets/photoinput.svg';
import Navbar from '../components/Navbar';

const cardData = [
  { img: photoinput, date: '2025.05.13', title: '비가 오기 직전의 고요함을 즐길 때', tags: ['차분한', '조용한'], location: '안산시 상록구 | 흐림', likes: 41 },
  { img: photoinput, date: '2025.05.14', title: '햇살이 좋은 날의 산책', tags: ['따뜻한', '산뜻한'], location: '안산시 단원구 | 맑음', likes: 27 },
  { img: photoinput, date: '2025.05.15', title: '카페에서의 여유', tags: ['여유', '포근함'], location: '안산시 고잔동 | 맑음', likes: 33 },
];

const Container = styled.div`
  width: 440px;
  height: 956px;
  background: #f5f5f5;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 32px 0;
`;

const CarouselWrapper = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 40px auto 0 auto;
  position: relative;
  width: 440px;
  overflow: hidden;
  height: 320px;
`;

const CardList = styled.div`
  display: flex;
  position: relative;
  width: 100%;
  height: 100%;
  justify-content: center;
  align-items: center;
  overflow: visible;
`;

const Card = styled.div`
  width: 340px;
  border-radius: 24px;
  background: #b7d8ce;
  box-shadow: 0 4px 24px 0 rgba(0,0,0,0.08);
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 24px 24px 18px 24px;
  margin-top: 0;
  transition: box-shadow 0.3s, background 0.3s;
`;

const AnimatedCard = styled(Card)`
  position: relative;
  transform: ${({ offset }) =>
    `translateX(${offset * 140}%) scale(${offset === 0 ? 1 : 0.85})`};
  opacity: ${({ offset }) => (Math.abs(offset) > 1 ? 0 : 1)};
  z-index: ${({ offset }) => 2 - Math.abs(offset)};
  transition: transform 0.4s cubic-bezier(.4,1.3,.5,1), opacity 0.3s;
  box-shadow: ${({ offset }) =>
    offset === 0
      ? '0 4px 24px 0 rgba(0,0,0,0.08)'
      : '0 2px 8px 0 rgba(0,0,0,0.04)'};
  background: ${({ offset }) =>
    offset === 0 ? '#b7d8ce' : '#e6f1ed'};
`;

const ArrowButton = styled.button`
  background: none;
  border: none;
  font-size: 32px;
  color: #b7d8ce;
  cursor: pointer;
  padding: 0 12px;
  user-select: none;
  &:hover { color: #2ad1be; }
`;

const CardImageWrapper = styled.div`
  width: 260px;
  height: 200px;
  border-radius: 18px;
  background: #e6f1ed;
  display: flex;
  align-items: center;
  justify-content: center;
  margin-bottom: 18px;
  position: relative;
`;

const CardImage = styled.img`
  width: 120px;
  height: 120px;
  object-fit: contain;
`;

const DateText = styled.div`
  font-size: 13px;
  color: #555;
  margin-bottom: 6px;
  margin-top: 2px;
`;

const Title = styled.div`
  font-size: 18px;
  font-weight: 600;
  color: #222;
  margin-bottom: 10px;
  text-align: left;
  width: 100%;
`;

const TagRow = styled.div`
  display: flex;
  gap: 8px;
  margin-bottom: 8px;
`;

const Tag = styled.div`
  border-radius: 16px;
  border: 1px solid #6ed1b7;
  background: #e6f7f1;
  color: #2ad1be;
  font-size: 13px;
  padding: 2px 12px;
  font-weight: 500;
`;

const InfoRow = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  margin-top: 8px;
`;

const Location = styled.div`
  font-size: 13px;
  color: #555;
`;

const Heart = styled.span`
  color: #ff5e5e;
  font-size: 18px;
  margin-left: 6px;
  vertical-align: middle;
`;

const LikeCount = styled.span`
  color: #ff5e5e;
  font-size: 15px;
  margin-left: 2px;
`;

const IndicatorRow = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 12px;
  gap: 6px;
`;

const IndicatorDot = styled.div`
  width: 8px;
  height: 8px;
  border-radius: 50%;
  background: ${({ active }) => (active ? '#2ad1be' : '#d0e6e0')};
`;

export default function Community() {
  const [current, setCurrent] = React.useState(0);

  const prevCard = () => setCurrent((prev) => (prev === 0 ? cardData.length - 1 : prev - 1));
  const nextCard = () => setCurrent((prev) => (prev === cardData.length - 1 ? 0 : prev + 1));

  return (
    <Container>
      <div style={{width: '100%', maxWidth: 440, margin: '0 auto'}}>
        <div style={{color:'#888', fontSize:13, marginBottom:8}}>
          학연산클러스터지원센터 5층<br/>
          경기 안산시 상록구 한양대학로 55
        </div>
        <div style={{fontSize:26, fontWeight:700, color:'#141414', lineHeight:1.3, marginBottom:6}}>
          영이님과 비슷한 감정인 유저<br/>329명이 방문한 장소에요.
        </div>
        <div style={{color:'#555', fontSize:15, marginBottom:12}}>
          영이님의 경험도 공유해주세요!
        </div>
        <div style={{display:'flex', justifyContent:'flex-end', marginBottom:10}}>
          <button style={{background:'#fff', border:'none', borderRadius:18, padding:'7px 18px', fontSize:16, color:'#888', fontWeight:500, boxShadow:'0 1px 4px 0 rgba(0,0,0,0.04)', cursor:'pointer'}}>인기순 ▼</button>
        </div>
      </div>
      <CarouselWrapper>
        <ArrowButton onClick={prevCard} aria-label="이전">&lt;</ArrowButton>
        <CardList>
          {cardData.map((card, idx) => {
            let offset = idx - current;
            if (offset === cardData.length - 1) offset = -1;
            if (offset === -(cardData.length - 1)) offset = 1;
            return (
              Math.abs(offset) <= 1 && (
                <AnimatedCard key={idx} offset={offset}>
                  <CardImageWrapper>
                    <CardImage src={card.img} alt="photoinput" />
                  </CardImageWrapper>
                  <DateText>{card.date}</DateText>
                  <Title>{card.title}</Title>
                  <TagRow>
                    {card.tags.map(tag => <Tag key={tag}>{tag}</Tag>)}
                  </TagRow>
                  <InfoRow>
                    <Location>{card.location}</Location>
                    <div><LikeCount>{card.likes}</LikeCount><Heart>♥</Heart></div>
                  </InfoRow>
                </AnimatedCard>
              )
            );
          })}
        </CardList>
        <ArrowButton onClick={nextCard} aria-label="다음">&gt;</ArrowButton>
      </CarouselWrapper>
      <IndicatorRow>
        {cardData.map((_, idx) => (
          <IndicatorDot key={idx} active={idx === current} />
        ))}
      </IndicatorRow>
      <Navbar />
    </Container>
  );
}
